import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor(){
    super();

    this.state = {
      monsters : ["rafi"]
    }
  }



  render () {
    return (
      <div className="App">
        <header className="App-header">
          {this.state.map(monster => <h1> {this.state.monsters}</h1>)}
        </header>
      </div>
    );
  }
}

export default App;
